import React from "react";
import "tailwindcss/tailwind.css"; // import trực tiếp tailwind

export default function App() {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-100 p-8">
      <h1 className="text-4xl font-bold text-blue-600 mb-4">
        Hệ thống Phát hiện Deepfake
      </h1>
      <p className="text-gray-700 mb-6">
        Sử dụng trí tuệ nhân tạo để phân tích video và phát hiện nội dung giả mạo.
      </p>

      <label className="mb-2 font-semibold">Chọn Phương pháp Phân tích</label>
      <select className="border rounded p-2">
        <option>Phân tích từng khung hình (Frame-based)</option>
        <option>Phân tích toàn bộ video (Video-based)</option>
      </select>
    </div>
  );
}
